import "./navbar.scss";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="brand">
        <span>Manager</span>
      </div>
      <div className="menu"></div>
      <div className="hamburger"></div>
      <div className="toggle"></div>
    </div>
  );
};

export default Navbar;
